import { Link } from "react-router-dom";
export function Register() {

  return( 
    <div className="auth"> 
      <h2 className="auth__title">Регистрация</h2>
      <form className="auth__form">
        <div className="auth__inputs-container">
        <input className="auth__input" type="text" name="email" placeholder="Email"></input>
        <input className="auth__input" type="text" name="password" placeholder="Пароль"></input>
        </div>
        <button className="auth__button" type="submit" aria-label="Зарегистрироваться">Зарегистрироваться</button>
      </form>
      <div className="auth__link-container">
        <Link to="/sign-in" className="auth__link">Уже зарегистрированы? Войти</Link>
      </div>
    </div> 
  ); 
}
